history = load "${App.Datasets.RBDemoLeadHistory.FullyQualifiedName}";
history = filter history by 'FIELD' == "Status";
leads = load "${App.Datasets.RBDemoLead.FullyQualifiedName}";

leads_start = filter leads by date('CREATEDDATE_Year', 'CREATEDDATE_Month', 'CREATEDDATE_Day') in {{cell(Start_date_1.selection,0,"leads_start").asObject()}};
leads_end = filter leads by date('CREATEDDATE_Year', 'CREATEDDATE_Month', 'CREATEDDATE_Day') in {{cell(End_date_1.selection,0,"leads_end").asObject()}};

history_for_start = filter history by date('CREATEDDATE_Year', 'CREATEDDATE_Month', 'CREATEDDATE_Day') in {{cell(Start_date_1.selection,0,"history_for_start").asObject()}};
history_for_end = filter history by date('CREATEDDATE_Year', 'CREATEDDATE_Month', 'CREATEDDATE_Day') in {{cell(End_date_1.selection,0,"history_for_end").asObject()}};

first_records_for_start = group history_for_start by 'LEADID';
first_records_for_start = foreach first_records_for_start generate 'LEADID', number_to_string(min('CREATEDDATE_sec_epoch'),"#") as 'CREATEDDATE_sec_epoch';

first_records_for_end = group history_for_end by 'LEADID';
first_records_for_end = foreach first_records_for_end generate 'LEADID', number_to_string(min('CREATEDDATE_sec_epoch'),"#") as 'CREATEDDATE_sec_epoch';


history_for_start = foreach history_for_start generate 'LEADID' as 'LEADID', number_to_string('CREATEDDATE_sec_epoch',"#") as 'CREATEDDATE_sec_epoch', 
'NEWVALUE' as 'NEWVALUE', 'OLDVALUE' as 'OLDVALUE';
first_records_for_start = group first_records_for_start by ('LEADID','CREATEDDATE_sec_epoch') left, history_for_start by ('LEADID','CREATEDDATE_sec_epoch');
first_records_for_start = foreach first_records_for_start generate first_records_for_start.'LEADID' as 'LEADID', first(history_for_start.'OLDVALUE') as 'OLDVALUE';

history_for_end = foreach history_for_end generate 'LEADID' as 'LEADID', number_to_string('CREATEDDATE_sec_epoch',"#") as 'CREATEDDATE_sec_epoch', 
'NEWVALUE' as 'NEWVALUE', 'OLDVALUE' as 'OLDVALUE';
first_records_for_end = group first_records_for_end by ('LEADID','CREATEDDATE_sec_epoch') left, history_for_end by ('LEADID','CREATEDDATE_sec_epoch');
first_records_for_end = foreach first_records_for_end generate first_records_for_end.'LEADID' as 'LEADID', first(history_for_end.'OLDVALUE') as 'OLDVALUE';

leads_start = group leads_start by 'ID' left, first_records_for_start by 'LEADID';
leads_start = foreach leads_start generate leads_start.'ID' as 'ID', coalesce(first(first_records_for_start.'OLDVALUE'),first(leads_start.'STATUS')) as 'STATUS', first(leads_start.'ISCONVERTED') as 'ISCONVERTED';

leads_end = group leads_end by 'ID' left, first_records_for_end by 'LEADID';
leads_end = foreach leads_end generate leads_end.'ID' as 'ID', coalesce(first(first_records_for_end.'OLDVALUE'),first(leads_end.'STATUS')) as 'STATUS', first(leads_end.'ISCONVERTED') as 'ISCONVERTED';


Start = filter leads_start by !('STATUS' in ["Closed - Not Converted", "Qualified"]);
Start = group Start by all;
Start = foreach Start generate "# Start" as 'Category', count() as 'Value';

End = filter leads_end by !('STATUS' in ["Closed - Not Converted", "Qualified"]);
End = group End by all;
End = foreach End generate "# End" as 'Category', count() as 'Value';

New = group leads_end by 'ID' left, leads_start by 'ID';
New = foreach New generate leads_end.'ID' as 'ID', 1 - count(leads_start) as 'Value';
New = group New by all;
New = foreach New generate "# New" as 'Category', sum('Value') as 'Value';

Converted_end = filter leads_end by 'STATUS' in ["Qualified"] && 'ISCONVERTED' == "true";
Converted_start = filter leads_start by 'STATUS' in ["Qualified"] && 'ISCONVERTED' == "true";
Converted = group Converted_end by 'ID' left, Converted_start by 'ID';
Converted = foreach Converted generate Converted_end.'ID' as 'ID', 1 - count(Converted_start) as 'Value';
Converted = group Converted by all;
Converted = foreach Converted generate "# Converted" as 'Category', sum('Value') as 'Value';

Disqualified_end = filter leads_end by 'STATUS' in ["Closed - Not Converted"];
Disqualified_start = filter leads_start by 'STATUS' in ["Closed - Not Converted"];
Disqualified = group Disqualified_end by 'ID' left, Disqualified_start by 'ID';
Disqualified = foreach Disqualified generate Disqualified_end.'ID' as 'ID', 1 - count(Disqualified_start) as 'Value';
Disqualified = group Disqualified by all;
Disqualified = foreach Disqualified generate "# Disqualified" as 'Category', sum('Value')  as 'Value';

result = group Start by all full, New by all full, Converted by all full, Disqualified by all full, End by all;
result = foreach result generate coalesce(sum(Start.'Value'),0) as 'Start', coalesce(sum(New.'Value'),0) as 'New', coalesce(sum(Converted.'Value'),0) as 'Converted',
coalesce(sum(Disqualified.'Value'),0) as 'Disqualified', coalesce(sum(End.'Value'),0) as 'End';

